import React from "react";
import logo from "../Assets/images/logo.png";

export default function header() {
  return (
    <div className="container mx-auto">
      <div className="w-full my-5">
        <div className="logo">
          <img src={logo} alt="" />
        </div>
      </div>
    </div>
  );
}
